import React from 'react';
import '../../views/Problems/Problems.css';

const Problem = ({title, difficulty, solved, category, content, option_1, option_2, option_3, option_4}) => {
  return (
  <tr>
    <td>{title}</td>
    <td><p>{content}</p>
       <ul>
          <li>1.<strong>{option_1}</strong></li>
          <li>2.<strong>{option_2}</strong></li>
          <li>3.<strong>{option_3}</strong></li>
          <li>4.<strong>{option_4}</strong></li>
        </ul>

    </td>
    <td>{difficulty}</td>
    <td>{category}</td>
    <td>{Number(solved)}</td>
  </tr>
  );
}

export default Problem;

